import Header from "../components/Header";
import Button from "../components/Button";
// import Body from "../components/Body";
import { useNavigate } from "react-router-dom";
import React from "react";
import Modal from "react-modal";
import { useState } from "react";
import LoginEmail from "../components/login/LoginEmail";
import LoginMain from "../components/login/LoginMain";

const TestMain = ({role}) => {
    const navigate = useNavigate();
    const [modalIsOpen, setModalIsOpen] = useState(false);
    const [showContent1, setShowContent1] = useState(true);

    const KAKAO_REDIRECT_URI = `https://mapdagu.site/oauth2/authorization/kakao`;
    const NAVER_REDIRECT_URI = `https://mapdagu.site/oauth2/authorization/naver`;
    const GOOGLE_REDIRECT_URI = `https://mapdagu.site/oauth2/authorization/google`;
    
    const goTest = () => {
        if(role === ""){
            navigate(`/login`);
        } else if(role === "USER"){
            navigate(`/main`);
        } else if(role === "NOT_TEST_USER"){
            navigate(`/test`);
        } else {
            navigate(`/set_profile`);
        }
    }
    const kakaoLoginHandler = () => {
        window.location.href = KAKAO_REDIRECT_URI;
        // KakaoRedirect();
    }
    const naverLoginHandler = () => {
        window.location.href = NAVER_REDIRECT_URI;
    }

    const googleLoginHandler = () => {
        window.location.href = GOOGLE_REDIRECT_URI;
    }

    const onChange = () => {
        setShowContent1(false);
    }

    return (
        <div>
            <Header title={"테스트 시작 페이지"}/>
            <Button text={"테스트 시작하기"} onClick={() => setModalIsOpen(true)}/>
            <Modal ariaHideApp={false} isOpen={modalIsOpen} onRequestClose={() => setModalIsOpen(false)}>    
                {/* <div>
                    <Button text="카카오" onClick={kakaoLoginHandler}/>
                    <Button text="네이버" onClick={naverLoginHandler}/>
                    <Button text="구글" onClick={googleLoginHandler}/>
                    <Button text="이메일" onClick={() => setModalIsOpen(false)}/>
                </div>
                <div><Button text="나중에 할래요" onClick={() => setModalIsOpen(false)}/></div> */}
                {showContent1 ? <LoginMain onChange={onChange}/> : <LoginEmail/>}
            </Modal>
        </div>
    )
}

export default TestMain;
